import React, { Component } from "react";
import { Typography } from "@material-ui/core";
import HeaderImg from "../assets/_DSC5675.jpg";
import "./Home.css"






export default class Home extends Component {

    render() {
        return (
            <div id="content" >

                <div id="left">
                    <div>
                        <Typography className="title" variant="h4">
                            A fresher way to clean your home
                </Typography>
                        <Typography className="body" variant="body1">
                            Organic and non-toxic cleaning products for a clean and chemical free finish.
                </Typography>

                    </div>

                </div>
                <div id="right">
                    <img id="headerImg" src={HeaderImg} />
                </div>
            </div>

        );
    }

}
